import axios from "axios";

const api1 = axios.create({
  baseURL: "https://fakestoreapi.com/products?limit=5",
});

const api2 = axios.create({
  baseURL: "https://webapp353621.ip-45-79-142-173.cloudezapp.io/api",
});

const getItems = async () => {
  try {
    const response1 = await api1.get("/");
    const response2 = await api2.get("/");

    const itemsFromApi1 = response1.data;
    const itemsFromApi2 = response2.data;

    return { itemsFromApi1, itemsFromApi2 };
  } catch (error) {
    console.error("Erro ao obter itens das APIs:", error);
    throw error;
  }
};

export default getItems;
